INSERT INTO `policy` VALUES (1,'DISCLAIMER','All the contents of this Site are only for general information or use. They do not constitute advice and should not be relied upon in making (or refraining from making) any decision <b>Shijavi Roadways</b> hereby excludes any warranty, express or implied, as to the quality, accuracy, timeliness, completeness, performance, fitness for a particular purpose of the Site or any of its contents, including (but not limited) to any financial tools contained within the Site. <b>Shijavi Roadways</b> will not be liable for any damages (including, without limitation, damages for loss of business projects, or loss of profits) arising in contract, tort or otherwise from the use of or inability to use the Site, or any of its contents, or from any action taken (or refrained from being taken) as a result of using the Site or any such contents.<b>Shivaji Roadways</b>, makes no warranty that the contents of the Site are free from infection by viruses or anything else which has contaminating or destructive properties.'),(2,'ACCESSIBILITY STATEMENT','The Official website of the <b>Shivaji Roadways</b> has been built with an aim to provide maximum accessibility and usability to its visitors. This website can be viewed from a variety of devices such as Desktop or Laptop computers, web-enabled mobile devices, WAP phones, PDAs, etc. However, currently Portable Document Format (PDF) files are not fully accessible We aim to be standards compliant and follow principles of usability and universal design, which should help all visitors of this website. This website is designed to meet the Guidelines for Indian Government Websites and also adheres to level AA of the Web Content Accessibility Guidelines (W.C.A.G.) 2.0 laid down by the World Wide Web Consortium (W.3.C.). Part of the information in the website is also made available through links to external Websites. External Websites are maintained by the respective departments who are responsible for making their sites accessible. If you face any problem or have suggestions regarding the accessibility of this website, please do let us know the nature of the problem along with your contact information to get back to you at the earliest.'),(3,'Copyright Policy','Contents of this website may not be reproduced partially or fully, without due permission from <b>Shivaji Roadways</b>. If referred to as a part of another website, the source must be appropriately acknowledged. The contents of this website cannot be used in any misleading or objectionable context.'),(4,'Privacy Policy','We do not collect personal information for any purpose other than to respond to you (for example, to respond to your queries). If you choose to provide us with personal information like filling out a Contact Us form with an e-mail address or postal address, and submitting it to us through the website, we use that information to respond to your message, and to help you get the information you have requested.\n\nOur website never collects information or creates individual profiles for commercial marketing. While you must provide an e-mail address for a localized response to any incoming questions or comments to us, we recommend that you do NOT include any other personal information.'),(5,'Hyperlink Policy','We do not object to you linking directly to the information that is hosted on our site and no prior permission is required for the same. However, we would like you to inform us about any links provided to our site so that you can be informed of any changes or updations therein. Also, we do not permit our pages to be loaded into frames on your site. Our website\'s pages must load into a newly opened browser window of the user.'),(6,'Term & Conditions','This website is Designed, Developed and Maintained by Delhi Transport Corporation Department\n\nThese terms and conditions shall be governed by and construed in accordance with the Indian Laws. Any dispute arising under these terms and conditions shall be subject to the jurisdiction of the courts of India.\n\nThe information posted on this website could include hypertext links or pointers to information created and maintained by non-Government/private organizations. <b>Shivaji Roadways</b> is providing these links and pointers solely for your information and convenience. When you select a link to an outside website, you are leaving the \'Guidelines for Indian Government Websites\' site and are subject to the privacy and security policies of the owners/sponsors of the outside website.');
